class LoadDetailsPage extends Component<any, any> {
	pdfbase64: string;
	binaryData: string;
	//binaryData: string;
	constructor(props: any) {
		super(props);
		console.log("PLATORM:", props.getPlatform);
		this.state = {
			tab: false,
			toggleBtn: false,
			show: false,
			showTerms: true,
			showDocument: true,
			showStops: true,
			showModal: false,
			url: ''
		};
		this.pdfbase64 = 'data:application/pdf;base64, JVBERi0xLjUKJdDUxdgKMTYgMCBvYmoKPDwKL0xlbmd0aCAzMDE3ICAgICAgCi9GaWx0ZXIgL0ZsYXRlRGVjb2RlCj4 + CnN0cmVhbQp42qUZx3LkxvXOr8DJwlSRENAIDei2QSuvpLXXIhWqtKpaDNDkwEQYITD46 / 1SA5jhUKbkC9l4 / br75TS + c + P4zjdn / v / ';
		this.binaryData = window.btoa(this.pdfbase64);

		this.loadTerms = this.loadTerms.bind(this);
		this.loadDocuments = this.loadDocuments.bind(this);
		this.loadStops = this.loadStops.bind(this);
	}

	loadTerms() {
		this.setState({ showTerms: !this.state.showTerms });
	}

	loadDocuments() {
		this.setState({ showDocument: !this.state.showDocument });
	}

	loadStops() {
		this.setState({ showStops: !this.state.showStops });
	}

	showPdf = async (name: any) => {
		///  TODO - check pdf or image from data and append to fileName.
		try {

			let url: any;
			if (this.props.getPlatform === 'web') {
				url = this.savePDFWeb(this.pdfbase64);
			} else {
				const { writeFileToDisk } = await FileSaver(this.pdfbase64, FilesystemDirectory.Documents, "CachePDF.pdf");
				url = await writeFileToDisk();
			}
			this.setState({ url, showModal: true });

		} catch (e) {
			console.log("ERRR", e);
		}
	}

	onPDFLoadComplete = () => {
		console.log("PDFF LOADED:")
	}

	savePDFWeb = (base64: string) => {

		var startIndex = base64.indexOf("base64,") + 7;

		var b64 = base64.substring(startIndex);

		var byteCharacters = atob(b64);

		var byteNumbers = new ArrayBuffer(byteCharacters.length);

		var byteArray = new Uint8Array(byteNumbers);

		for (let i = 0; i < byteCharacters.length; i++) {
			byteArray[i] = byteCharacters.charCodeAt(i);
		}

		const fileBlob = new Blob([byteArray], { type: 'application/pdf' });
		return URL.createObjectURL(fileBlob);
	}

	render() {

		const loadDetails = this.props.loadDetails;
		const stopCount = this.props.stopCount;
		const stop_details = this.props.stopDetails;
		let PDFRender: any;

		if (this.props.getPlatform === 'web') { // For Web

			PDFRender = (this.state.url.length != '')
				? <PDFReader
					url={this.state.url}
					showAllPage={true}
					isShowHeader={false}
					isShowFooter={true} scale={1}
					onDocumentComplete={this.onPDFLoadComplete}
				/>
				: ''
		} else { // For Mobile

			PDFRender = (this.state.url.length != '')
				? <MobilePDFReader
					url={this.state.url}
					showAllPage={true}
					isShowHeader={false}
					isShowFooter={true}
					onDocumentComplete={this.onPDFLoadComplete
					}
				/>
				: ''
		}

		let pageName = "";
		let footerOptions: any = [];
		if (this.props.module === "home/recommended" || this.props.module === "home/watched" || this.props.module === "search") {
			pageName = "loadPage"
		}
		else if (this.props.module === "MyLoad/CarrierAssigned") {
			pageName = "carrierAssign";
			footerOptions = [{
				"icon": "assets/icon/assign_icon.svg",
				"label": "ASSIGN DRIVER"
			},
			{
				"icon": "assets/icon/call-black.svg",
				"label": "CALL"
			}, {
				"icon": "assets/icon/chat=black.svg",
				"label": "CHAT"
			}
			]
		}

		return (
			<>
				{loadDetails ?
					<IonPage className="desktop-page loadDetails-page">
						<AppHeader title={"Load#" + (loadDetails ? loadDetails.schneider_loads_id : "")} backUrl={"/app/" + this.props.module} isMap={true} tab={this.props.module} />
						<IonContent className="ion-padding custom-padding load-page-content">
							<IonCard className="loadDetails_card">
								<IonCardContent className="card-content">
									<LoadTile {...loadDetails} module={this.props.module} footerOptions={footerOptions} showFooter={true} pageName={pageName} {...this.props} />
								</IonCardContent>
							</IonCard>
							<StopDetailContent stopCount={this.props.stopCount} stopDetails={this.props.stopDetails} pageName={pageName} />
							{/* <DocumentCard mock_document_details={mock_document_details} /> */}
							<TermsAndCondition />

							<IonButton onClick={this.showPdf} >Show PDF</IonButton>
							<IonModal isOpen={this.state.showModal} backdropDismiss={false}>
								<IonContent className="ion-padding custom-padding load-page-content">
									{PDFRender}
									<IonButton onClick={() => this.setState({ url: "", showModal: false })}>Close Modal</IonButton>
								</IonContent>
							</IonModal>
						</IonContent>
					</IonPage>
					: ""
				}
			</>
		);
	}
}
export default LoadDetailsPage;
